<script type="text/javascript">
function adjustForMinMaxDashboardSizes(image)
{
    var v = {h:image.parentNode.offsetHeight, w:image.parentNode.offsetWidth};

    //adjust for min/max dashboard sizes
    var cs = tsConfig.composite_size;

    if (cs.maxw === 0 && cs.maxh === 0)
      return;

    if (v.w < cs.minw)
      v.w = cs.minw;
    else if (cs.maxw !== 0 && v.w > cs.maxw)
      v.w = cs.maxw;

    if (v.h < cs.minh)
      v.h = cs.minh;
    else if (cs.maxh !== 0 && v.h > cs.maxh)
      v.h = cs.maxh;

    // TODO use CSS styles a per FOGBUGZ issue 57662
    // 30px + 1px border for tabs; 8px + 1px border for no tabs
    // There is always an 8px border on dashboards that is not user-configurable
    image.style.height = (v.h - 9) + "px";
    image.style.width = (v.w - 8) + "px"; // 8px is added to all dashboards
}

function _getScaledDimension(image, index)
{
    if (! image.style.backgroundSize)
      return;

    var sizeStrings = image.style.backgroundSize.split(" ");
    if (sizeStrings.lengh <= 1)
      return;

    return parseInt(sizeStrings[index], 10);
}

function adjustHeightForAutoSizedVizes(image)
{
    if (image.style.height !== "auto")
      return;

    var scaledBackgroundHeight = _getScaledDimension(image, 1);
    if (! scaledBackgroundHeight)
      return;

    image.style.height = scaledBackgroundHeight+"px";
}

function adjustWidthForAutoSizedVizes(image)
{
    if (image.style.width !== "auto")
      return;

    var scaledBackgroundWidth = _getScaledDimension(image, 0);
    if (! scaledBackgroundWidth)
      return;

    image.style.width = scaledBackgroundWidth+"px";
}

function resizeStaticImage(e)
{
    var image = document.getElementById("staticImage");
    if (image === null) return;

    adjustForMinMaxDashboardSizes(image);
    adjustHeightForAutoSizedVizes(image);
    adjustWidthForAutoSizedVizes(image);

}
resizeStaticImage();
</script>
